    const [name, setName] = useState();
    const [email, setEmail] = useState();
    const [password, setPassword] = useState();
    const [confirmpassword, setConfirmpassword] = useState();
    const [pic, setPic] = useState();

  return (
    <VStack spacing={'5px'}>
          <FormControl>
              <FormLabel>
                  <Input>
                      placeholder="Name"
                      onChange={(e)=>setName(e,target.val)}
                  </Input>
              </FormLabel>
      </FormControl>
    </VStack>
  )
}

